import React, { useRef, useState } from 'react';
import { motion } from 'framer-motion';
import profileImage from '../Uploads/vijju.png';
import projectsData from './Projects';
import './Home.css';

const containerVariants = {
    hidden: { opacity: 0, y: -20 },
    visible: {
        opacity: 1,
        y: 0,
        transition: {
            staggerChildren: 0.2,
        },
    },
};

const childVariants = {
    hidden: { opacity: 0, y: -20 },
    visible: { opacity: 1, y: 0 },
};

const continuousMotion = {
    animate: {
        y: [0, -10, 0],
        transition: {
            duration: 2,
            repeat: Infinity,
            repeatType: 'loop',
        },
    },
};

const Home = () => {
    const aboutRef = useRef(null);
    const skillsRef = useRef(null);
    const projectsRef = useRef(null);
    const contactRef = useRef(null);

    const scrollToRef = (ref) => {
        const yOffset = -document.querySelector('header').offsetHeight; // Adjust for header height
        const y = ref.current.getBoundingClientRect().top + window.pageYOffset + yOffset;
        window.scrollTo({ top: y, behavior: 'smooth' });
    };

    const [expandedProject, setExpandedProject] = useState(null);

    const toggleProject = (projectId) => {
        setExpandedProject(expandedProject === projectId ? null : projectId);
    };

    return (
        <div>
            <header>
                <div className="name">
                    <h1>
                        MY <span className="portfolio">PORTFOLIO</span>
                    </h1>
                </div>
                <nav>
                    <ul>
                        <li><a href="#about" onClick={() => scrollToRef(aboutRef)}>About Me</a></li>
                        <li><a href="#skills" onClick={() => scrollToRef(skillsRef)}>Skills</a></li>
                        <li><a href="#projects" onClick={() => scrollToRef(projectsRef)}>Projects</a></li>
                        <li><a href="#contact" onClick={() => scrollToRef(contactRef)}>Contact</a></li>
                    </ul>
                </nav>
            </header>
            <section ref={aboutRef} id="about" className="about-section">
                {/* About section content */}
            </section>
            <section ref={skillsRef} id="skills" className="skills-section">
                {/* Skills section content */}
            </section>
            <section ref={projectsRef} id="projects">
                <h2>My Projects</h2>
                <div className="projects-container">
                    {projectsData.map((project, index) => (
                        <motion.div
                            key={index}
                            className="project-item"
                            initial="hidden"
                            animate="visible"
                            variants={containerVariants}
                            onClick={() => toggleProject(index)}
                        >
                            <h3>{project.title}</h3>
                            {expandedProject === index && (
                                <div className="project-details">
                                    <p>{project.description}</p>
                                    <video controls>
                                        <source src={project.videoSrc} type="video/mp4" />
                                        Your browser does not support the video tag.
                                    </video>
                                </div>
                            )}
                        </motion.div>
                    ))}
                </div>
            </section>
            <section ref={contactRef} id="contact">
                {/* Contact section content */}
            </section>
        </div>
    );
};

export default Home;
